import React, { useState } from "react";
import { Form, Button, Container, Row, Col } from 'react-bootstrap';

export default function Signup() {
    const [cabAgencyName, setCabAgencyName] = useState('');
    const [cabAgencyMobileNumber, setCabAgencyMobileNumber] = useState('');
    const [cabAgencyEmail, setCabAgencyEmail] = useState('');
    const [cabAgencyPassword, setCabAgencyPassword] = useState('');


    const signupHandler=(e)=>{


        console.log(setCabAgencyName+" "+setCabAgencyEmail+" "+setCabAgencyMobileNumber+" "+setCabAgencyPassword)
    }

    return (
        <Container className="pt-3">
            <Row>
                <Col xs={4}></Col>
                <Col xs={4} className="pt-5">
                    <h2>Cab Agency Registration</h2>
                    <Form id="form-driver-signup" onSubmit={signupHandler}  >

                        <Form.Group className="mb-3">
                            <Form.Label>Cab Agency name</Form.Label>
                            <Form.Control 
                            type="text" required 
                            value={cabAgencyName}
                            onChange={(e) => setCabAgencyName(e.target.value)} />
                            <Form.Text className="text-danger">Cab Agency Name is required.</Form.Text>
                        </Form.Group>

                        <Form.Group className="mb-3">
                            <Form.Label>Cab Agency MobileNumber</Form.Label>
                            <Form.Control 
                            type="number" required 
                            value={cabAgencyMobileNumber}
                            onChange={(e) => setCabAgencyMobileNumber(e.target.value)} pattern="[0-9]{10}" title="Please enter a 10-digit mobile number (0-9) without spaces or special character" />
                            <Form.Text className="text-danger">Cab Agency Mobile Number is required.</Form.Text>
                        </Form.Group>

                        <Form.Group className="mb-3">
                            <Form.Label>Cab Agency Email</Form.Label>
                            <Form.Control type="email" 
                            required value={cabAgencyEmail} 
                            onChange={(e) => setCabAgencyEmail(e.target.value)} />
                            <Form.Text className="text-danger">Cab Agency Email is required.</Form.Text>
                        </Form.Group>

                        <Form.Group className="mb-3">
                            <Form.Label>Cab Agency Password</Form.Label>
                            <Form.Control 
                            type="password" required 
                            value={cabAgencyPassword} onChange={(e) => setCabAgencyPassword(e.target.value)} />
                            <Form.Text className="text-danger">Cab Agency Password is required.</Form.Text>
                        </Form.Group>

                        <Button type="submit" variant="primary">Register</Button>
                    </Form>
                </Col>
            </Row>
        </Container>
    );
}
